import React, { useState } from 'react';
import Accordion from 'react-bootstrap/Accordion';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';

const Services = () => {
    const [typeServiceF, settypeServiceF] = useState(false);

    const handletypeServiceFChange = (e) => {
        //settypeServiceF(!typeServiceF)
        settypeServiceF(e.target.value);
    };

    const [priceF, setPriceF] = useState(false);

    const handlepriceFChange = (e) => {
        //setPriceF(!priceF)
        setPriceF(e.target.value);
    };

    const [timeF, settimeF] = useState(false);

    const handletimeFChange = (e) => {
        //settimeF(!timeF)
        settimeF(e.target.value);
    };

    const data = 
    [
        { type: 'Body Treatment', price: '175', time: '75'},
        { type: 'Body Treatment', price: '130', time: '60'},
        { type: 'Body Treatment', price: '100', time: '50'},
        { type: 'Facial Treatment', price: '175', time: '60'},
        { type: 'Facial Treatment', price: '130', time: '75'},
        { type: 'Facial Treatment', price: '100', time: '40'},
        { type: 'Esthetic', price: '175', time: '75'},
        { type: 'Esthetic', price: '130', time: '75'},
        { type: 'Esthetic', price: '100', time: '60'}
    ];

    const filteredData = data.filter((item) => {
        if (typeServiceF && item.type !== typeServiceF) {
          return false;
        }
        if (priceF && item.price !== parseInt(priceF)) {
          return false;
        }
        if (timeF && item.time !== timeF) {
          return false;
        }
        return true;
    });

    return (
        <div>
          <div style={{ display: 'flex' }}>
            <div>
              <h2>Bachelors</h2>
              <div>
                <label>Program:</label>
                <select value={programFilter} onChange={handleProgramFilterChange}>
                  <option value="">All</option>
                  <option value="BodyTreatment">Body Treatment</option>
                  <option value="Software">Software</option>
                  <option value="Electrical">Electrical</option>
                  <option value="Languages">Languages</option>
                </select>
              </div>
              <div>
                <label>Age:</label>
                <select value={ageFilter} onChange={handleAgeFilterChange}>
                  <option value="">All</option>
                  <option value="20">20</option>
                  <option value="21">21</option>
                  <option value="23">23</option>
                </select>
              </div>
              <div>
                <label>Language:</label>
                <select value={languageFilter} onChange={handleLanguageFilterChange}>
                  <option value="">All</option>
                  <option value="English">English</option>
                  <option value="Spanish">Spanish</option>
                  <option value="French">French</option>
                </select>
              </div>
            </div>
            <div>
              <h3>Filtered Results:</h3>
              <ul>
                {filteredData.map((item, index) => (
                  <li key={index}>
                    Program: {item.program}, Age: {item.age}, Language: {item.language}
                  </li>
                ))}
              </ul>
            </div>
          </div>
        </div>
      );

}
export default Services;
